import React from 'react'

const Grid = ({ rows, cols }) => {
    const nodes = [];
    for (let x = 0; x < rows; x++) {
        for (let y = 0; y < cols; y++) {
            nodes.push(<Node key={[x, y]} />)
        }
    }
    return (
        <div className='grid' style={{ width: rows * 50, height: cols * 50 }}>
            {nodes}
        </div>
    )
}

export default Grid
